function Certificate() {
    this.apiRequestedUrl = "https://api.certore.com";
    this.certoreUrl = "https://certore.com";
    this.bannerLight = "data:image/png;base64,";
    this.bannerDark = "data:image/png;base64,";
}

Certificate.prototype.loadImage = function (data, callback) {
    var image = new Image;

    image.onload = function () {
        callback(image);
    };
    image.src = data;
};
Certificate.prototype.getBanner = function (value, isThemeDark, bannerImage) {
    var canvas = document.createElement("canvas"),
        context = canvas.getContext("2d"),
        cert = new Certificate(),
        data;

    canvas.width = 120;
    canvas.height = 60;
    data = isThemeDark ? cert.bannerDark : cert.bannerLight;

    Certificate.prototype.loadImage(data, function (image) {
        var fontColor = isThemeDark ? "#dedede" : "#1c1c1c";

        context.drawImage(image, 0, 0);
        context.fillStyle = fontColor;
        context.font = "10px Arial";
        context.fillText("Certificate", 40, 20);
        context.fillText("v1.0.0", 40, 30);
        context.font = "16px Arial";
        if (isThemeDark) {
            context.fillStyle = "#32b1a7";
        }
        context.fillText("class", 60, 50);
        context.fillStyle = "#32b1a7";
        context.font = "24px Arial";
        context.fillText(value.toUpperCase(), 100, 50);
        bannerImage.src = canvas.toDataURL();
    });
};
Certificate.prototype.obtain = function (options) {
    var version = undefined !== options.version && null !== options.version ? options.version : '1.0',
        isDark = undefined !== options.theme && null !== options.theme && 'dark' === options.theme,
        appendTo = undefined !== options.appendTo && null !== options.appendTo ? options.appendTo : 'body',
        appendElm = document.querySelector(appendTo),
        value = undefined !== options.value && null !== options.value ? options.value : false,
        style = undefined !== options.style && null !== options.style ? options.style + ' display: inline-block; overflow: hidden; border-radius: 6px;' : "display: inline-block; position: absolute; top: 12px; left: 12px; z-index: 999; background: transparent; overflow: hidden; border-radius: 6px;",
        cert = new Certificate(),
        apiRequestedUrl = cert.apiRequestedUrl,
        image = document.createElement('img');

    if (!value) {
        throw "Value should be set to obtain certificate";
    }

    image.classList.add("certore-certificate");

    Certificate.prototype.sendRequest(
        apiRequestedUrl + "/api/no-auth/v" + version + "/certificate&obtain&value=" + value,
        function (response) {
            var data = JSON.parse(response),
                linkElm = document.createElement('a');

            linkElm.classList.add("certore-certificate-link");
            linkElm.setAttribute("href", cert.certoreUrl + "/token&certificate-value=" + value);
            linkElm.setAttribute("style", style);
            linkElm.append(image);

            cert.getBanner(data.class, isDark, image);

            if (appendElm.hasChildNodes()) {
                appendElm.insertBefore(linkElm, appendElm.firstChild);
            } else {
                appendElm.appendChild(linkElm);
            }
        },
        function (errorMessage) {
            console.error(Certificate.prototype.getErrorMessage(errorMessage));
        },
        "GET"
    );
};
Certificate.prototype.sendRequest = function (url, onSuccess, onFail, method, data) {
    var request = new XMLHttpRequest();

    request.onreadystatechange = function () {
        if (request.readyState === XMLHttpRequest.DONE) {
            if (request.status === 200) {
                onSuccess(request.responseText);
            } else {
                onFail(request.responseText);
            }
        }
    };

    request.open(method, url, true);
    if (undefined !== data && null !== data && 0 < data.length) {
        request.setRequestHeader("Content-Type", "application/json");
        request.send(data);
    } else {
        request.send();
    }
};
Certificate.prototype.getErrorMessage = function (errorMessage) {
    var json = errorMessage ? JSON.parse(errorMessage) : null,
        unknownError = "Something went wrong...";

    return json ? (json.message || (json.error ? json.error.message : unknownError)) : unknownError;
};